import React from 'react';
import './App.css';
import Navbar from './components/navbar/Navbar';
import Clarifai from 'clarifai';
import Logo from './components/logo/Logo';
import Rank from './components/rank/Rank'
import FaceRecogination from './components/FaceRecogination/FaceRecogination'
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm'
const app = new Clarifai.App({
      apiKey: "8821cc9a7a764a11a48e02afbce265fd",
    });

class App extends React.Component{
  constructor(){
    super()
    this.state ={
      input : '',
      imageUrl : ''
    }
  }

  onSearchChange= (event) =>{
    console.log(event.target.value)
  }

  onButtonClick =() =>{
    this.setState({imageUrl :this.state.input});
    app.models
      .predict(
        Clarifai.FACE_DETECT_MODEL,
        // THE JPG
        "https://i.insider.com/5d321d4ea209d3146d650b4a?width=1100&format=jpeg&auto=webp"
      )
      .then((response) => {
        console.log(response);
      })
      .catch((err) => {
        console.log(err);
      });

  }
  render(){
     return (
      <div className="App">

         <Navbar/>
         <Logo/>
         <Rank/>
         <ImageLinkForm
         onSearchChange = {this.onSearchChange}
         onButtonClick = {this.onButtonClick} />
         <FaceRecogination imageUrl = {this.state.imageUrl}/>
      </div>
    );
   }
  }

export default App;
